<script language="javascript">
function U(F, Coords, Width, Height)
{
   var Z = document.getElementById("MyZoom");
   
   Z.src =  F ;
   Z.style.display = '';
   var C = Coords;
   
   var Top    = C.substr(C.indexOf(","), C.length);   
   var Right  = Top.substr(Top.indexOf(","), Top.length);

   var Left   = C.substring(0, C.indexOf(","));
   var Top    = Top.substring(0, Top.indexOf(","));
   var Right  = Right.substring(0, Right.indexOf(","));   
   var Bottom = C.substr(C.lastIndexOf(","), C.length);
   
   Z.style.left    = Right;
   Z.style.top     = Bottom;
   Z.style.width   = Width;
   Z.style.height  = Height;
   Z.style.opacity = '1';
}

function HidePopUp()
{
   var Z = document.getElementById("MyZoom");
   Z.style.opacity = '0';
   Z.style.width   = 1;
   Z.style.height  = 1;
}

</script>
